import React from "react";

import "./App.css";
import HeaderBar from "./components/HeaderBar";

function App() {
  state = {
    userInfo: {
      username: "JessJelly",
    },
  };
  return (
    <div className="App">
      <HeaderBar username={this.state.userInfo.username} />
    </div>
  );
}

export default App;
